import { useState, useRef } from "react";
import emailjs from '@emailjs/browser';
import carl from '../../cat.svg'
import HK_GIF from './../../Photos/hello_kitty.gif'



function HelloKitty(){

    return (
        <div className='bg-HKitty-Pink w-full h-screen flex justify-center items-center'>

            <div className="bg-HKWHITE w-[500px] h-48 rounded-lg place-content-center">
            <img className='h-24 w-24 rounded-full border-6 border-slate-900 ' src={HK_GIF} />
            </div>

        </div>
    )

}
export default HelloKitty;
